import Link from 'next/link';


export default function Menu() {
  return (
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
      </li>

      <li>
        <Link href="/about">
          <a>About me</a>
        </Link>
      </li>

      <li>
        <Link href="/work">
          <a>My work</a>
        </Link>
      </li>

      <li>
        <Link href="/contact">
          <a>Contact</a>
        </Link>
      </li>
      <style jsx>{`
       ul{
        display: flex
        justifyContent: space-between;
        listStyleType: none;
        paddingInlineStart: 0;
      }

      li{
          marginLeft: 2em
      }`}</style>
    </ul>
  );
}
